('1541','2','8103-1','Wohnung Letzerich',Null,'Moderne Wohnung mit traumhaften Meerblick in privilegierter Lage in Puerto Portals','14757','Diese zauberhafte Wohnung bietet Ihnen modernen, mediterranen Wohnkomfort in exzellenter Lage mit herrlichem Hafen- und Meerblick in Puerto Portals. Die Wohnung verfügt über einen Wohn- /Essraum mit großem Panoramafenster, 2 Schlafzimmer, 2 Badezimmer (1 en suite), eine moderne komplett ausgestatte Küche sowie eine 36 m² große Privatterrasse. Die Fußböden sind mit Marmor ausgelegt, die Fenster sind doppelverglast aus PVC und eine Klimaanlage warm/ kalt ist in allen Räumen vorhanden.\r\nDie Inneneinrichtung ist modern und hochwertig. Möbel und alle exklusiven Details sind im Verkaufspreis enthalten. Zum Objekt gehören weiterhin ein Abstellraum, Tiefgarage und ein großer Gemeinschaftspool. ','14758','655000','111','2011-03-08 13:20:59','106','2011-03-08 13:21:25',Null,'922','154','160',1,'1','0',Null,Null,Null,'14759',Null,'0','0','0',Null,'2015-09-22 10:15:25',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'14760',Null,'14761',Null,'14762',Null,'14763',Null,'14764','0',0,'5');
